import LaunchPanel from './launchPanel';

export default function Header (props) {

    let startYear = 2006;
    let endYear = 2020;
    let launchYearFilter = [];
    for(let i = startYear; i <= endYear; i++) {
        launchYearFilter.push(
            <button key={i} onClick={() => props.handleFilterYearClick(i)}> {i} </button>
        );
    }

    return (
        <div>
            <div>
                <h6>Filters</h6>
                <div>
                    <div>Year</div>
                    {launchYearFilter}
                </div>
            </div>

        </div>
    );
}
